INSERT INTO `car` VALUES (52,'8280 Trần Orchard, Hà Nam, ID TKPP 1JS',4,'OLD','Năm hương chỉ xe. Hương phá vẽ bạn. Phá biển đạp tím xe thì mướn trăng. Giết độc yêu thôi. Chín mây tám nón trời. Mướn bè cái việc quê anh xe mua. Được xanh tàu sáu. Trời bơi thương. Tàu nhà hàng sáu hết ghế. Hàng đâu khoan không khoan ruộng yêu.',1308505268,'Honda X5','1998',13),(53,'Apt. 283 872 Dương Station, Bến Tre, AR ZVPH 1JL',5,'NEW','Anh đâu tui yêu hương đạp. Một bốn tôi. Đồng thế chết máy chỉ quê viết. Vá trăng quần thuyền thương. Hàng ngọt hết. Làm chín xuồng. Xanh em cái. Vẽ xanh đá bốn hai đâu chín. Em chín con áo quần ngọt. Hàng đỏ thuyền thích. Mười ba không máy ba cái. Đồng ghế đá ba.',4060319614,'Lotus A5','1997',17),(54,'805 Lâm Lodge, Đồng Tháp, ID 9EHR 6RJ',6,'NEW','Vá tôi ruộng bảy trăng tô. Xanh được sáu năm hai ác giết xanh. Kim mua giết kim ghế ừ vá. Hết bơi nghỉ làm ngọt cửa. Khoảng kim đá may tám khâu. Bốn thôi đánh thuê. Quê chìm nghỉ. Máy tô thôi làm làm á. Thương chín vẽ đá mướn. Thuyền hàng nhà lầu. Mây tủ nón chín.',5994020633,'Audi Doblo','1994',10),(55,'537 Hà Isle, Long An, MI W1AA 0JJ',12,'NEW','Nhà thương đập đỏ mười biết. Á thuyền xanh hóa nhà việc tô đồng. May chín vàng thích. Con bốn ruộng hết trăng. Chết làm quê. Chín khoan đồng leo giết tám chết. Vá đá đạp con bảy tui. Á sáu năm tàu. Áo mây chết ruộng thế khâu phá bơi. Quê nghỉ độc được hóa khâu mười xuồng.',5307846051,'Porsche Model X','2003',14),(56,'8957 Hòa Union, Cao Bằng, SD M98P  5LX',5,'NEW','Giày khoảng thích bơi nhà quần đá đang. Ruộng đồng trời con trăng tím ghế. Không khoảng một. Không xanh bốn áo tô ba ờ ác. Tủ ờ hai thế đánh thế áo năm. Hết tủ đồng ờ ác máy tàu. Thì chín tôi yêu tôi. Ừ nhà đồng. Bè đá thế đạp chỉ bạn lầu. Cửa khoảng nhà khoan đâu xe leo nha. Viết vẽ ngọt. Kim tô đã núi may anh.',4621666752,'Geely 308','2024',19),(57,'Suite 565 2686 Vũ Lakes, Vĩnh Long, IN 9T8X 7JG',9,'NEW','Cửa giết hàng. Việc bảy áo ờ á. Thuê đang hết núi biển. Ruộng mây đang. Tôi áo thuyền đỏ. Hóa đá vàng một viết hai hai một. Trời khoảng việc anh tô yêu may. Nước mây được ruộng. Cửa ờ độc lỗi khâu chỉ khoảng. Trời thương nón biển. Hương thôi viết.',3601684646,'Noble C-Class','2021',3),(58,'5781 Kim Inlet, Ninh Bình, DE MF  8BJ',6,'OLD','Mây bàn ruộng thế tím ác. Mướn giết đồng. Một ghét hết năm đâu xanh tám bạn. Em tám không ruộng máy. Việc đánh em bốn đập quê trăng. Nha bàn ác năm. Á tủ mượn ghét năm cái bảy biển. Cửa tím cửa ngọt. Thế tô tô bốn em gì. Thương kim máy may làm. Khoan không tô nước may hàng hương thôi.',2674159351,'Subaru Camero','2022',4),(59,'873 Thảo Trace, Bạc Liêu, TX 6ET6 1ZL',8,'OLD','Đồng xe bơi yêu. Chín tím xe thôi tô. Chín chết xuồng nước. Hóa dép thì chỉ khâu tím hết. Tám hết hàng năm nón mướn ghét. Nước vá anh. Đá đá nước chín vàng hết. Năm may trời bạn chín hóa. Nón đâu đang tím tàu nhà tủ sáu. Máy máy đánh. Ác áo đánh.',3225572779,'Baojun Fabia','2014',8),(60,'Suite 152 25295 Thủy Shore, Cà Mau, WI ZDT9  7JA',8,'OLD','Tui sáu ừ may tôi vá. Đánh biển lầu đá. Tui xe đâu. Áo hết xuồng một sáu. Quần hết xuồng nước xanh. Khoan đâu trăng em chỉ. Anh không tui ừ hóa tôi. Hóa nghỉ một thương khoan biển xuồng. Giết độc hết bàn thì tôi. Lầu đã tám mua tím núi nón đâu. Bàn ác đá gì nước núi.',5594239253,'PGO G9','2017',4),(61,'44923 Lê Trail, Ninh Bình, FL 2OW  5RE',12,'OLD','Ngọt ruộng xuồng tô mướn bàn con. Dép đã hết núi làm nghỉ. Giày năm thích. Cái khâu bảy mướn việc thôi. Tôi anh vẽ mua. Bè nón năm đâu xe đạp nhà bảy. Lỗi hai giết. Gì lỗi tàu phá xe em leo. Vẽ nước ờ áo đạp kim núi. Kim tím tám hết nha.',2890938181,'Jaguar Linea','1994',9),(62,'32833 Nhàn Orchard, Hải Dương, ND TKB 9LJ',5,'OLD','Trời đâu đập đá mua. Thương chín anh. Tô chìm núi thuyền đang mười. Vá chín xuồng ghét thôi hết nón bè. Được biển mướn chín phá đạp. Khoảng đánh thương phá. Khâu khâu biết quần không vàng. Nước con ghét tím ghét mướn. Việc ba leo mây. Mười một đỏ phá đã đỏ tủ. Chín ba phá em. Bè mướn tủ chìm bảy đỏ cửa cái.',4939501138,'Land Rover A-Class','1999',1),(63,'Suite 844 36719 Tô Centers, Quảng Trị, WV 6AW  2LS',9,'OLD','Kim bảy đạp thuyền giày. Anh xe là thôi ừ đập. Đỏ bè bảy độc em khoan giày. Giết đập bốn biết thương. Chỉ đỏ biển. Nghỉ đồng ruộng thì nước năm. Chỉ cái chín hàng chỉ thôi. Tô đang hết thuyền khâu mượn hết. Ghét đá xuồng thích đánh thương tám tủ. Mướn ờ ruộng năm yêu. Đánh thì xe. Trăng bè dép đạp trăng em một máy.',2356415112,'Maruti Suzuki ET5','2009',1),(64,'Apt. 904 0548 Dương Unions, Đồng Tháp, VA ZDB 1BO',7,'OLD','Chìm lầu chín dép. Kim đỏ trời thôi ngọt máy. Đồng bơi biết xanh gì làm mây tủ. Tám bè phá vá lầu phá. Ừ lầu á. Xe xe cái làm làm việc. Giết tôi đập. Đỏ đâu đánh chìm mua sáu vàng. Hai núi nha vẽ. Biển khâu bảy anh máy đã. Vá hai tô anh mướn. Tám tui mua nón không vàng đã.',2776877170,'Nissan Altima','1994',1),(65,'Suite 217 7008 Lâm Flat, Đắk Lắk, NV TRVM 5RW',8,'OLD','Thích lầu dép. Đạp đập đá em khâu. Tui ác mây ba xe. Đánh hai nha thôi biết việc khâu. Không lầu anh. Chìm khâu yêu ruộng hóa xanh được tôi. Thích đá biển. Tôi chỉ trăng. Mười mướn nước thích ghế chìm bàn ruộng. Biển mượn chết ghét á đánh mười việc.',5934128627,'Daihatsu Prius','2025',7),(66,'68046 Nhàn Park, Lào Cai, MS 3X3M  1JE',4,'OLD','Chỉ khoan yêu mười thuyền. Nhà viết may ruộng thuê chết làm tui. Ngọt nha viết năm tô ghế tím thế. Bè xuồng yêu. Bốn việc mười leo. Một khâu hết leo lầu đỏ may. Đồng việc máy quê mướn. Xanh vàng giết. Mượn tô giết tám cái đồng đã. Vá đỏ biết may. Khoảng bạn bè trăng. Xuồng áo mượn tàu là núi nón.',4363484235,'Aixam Dedra','2017',18),(67,'Apt. 976 148 Lê Groves, Hải Dương, FL 4ONY  3ZH',9,'OLD','May đỏ nước đã bảy. Thuyền ác trăng. Mướn mướn biển thuê á. Hết giày yêu. Thì việc anh giày vẽ dép khoan đang. Đạp chỉ con nha hóa áo. Tàu là xanh khâu. Thế thì tủ máy đập dép thương bạn. Bạn quần sáu hương độc. Biển may được đang ghế. Khoảng bè viết ờ thuyền ừ.',1878976602,'Baojun Arona','2013',6),(68,'562 Nguyễn Mountains, Tuyên Quang, NH YNW  4UL',11,'OLD','Cửa bảy chết tàu ruộng mu